import React from 'react'
import { useParams } from 'react-router-dom';

export const UseofParam = () => {
    const {fname}=useParams();
    return (
        <>
        
            <h1>I'm Param {fname} 'PARAMETER'</h1>
        </>
    )
}

export default UseofParam;
